void weights_reshape(float *weights, int inputsize, int outputsize, int kernelHeight, int kernelWidth, float *new_weights){
    unsigned int i,j,k,l, index = 0;
    for (i=0;i<kernelHeight;i++){
        for (j=0;j<kernelWidth;j++){
            for (k=0; k<inputsize; k++){
                for (l=0;l<outputsize;l++){
                    new_weights[l * (inputsize * kernelHeight * kernelWidth) + k * (
                                                                    kernelHeight * kernelWidth) + i * kernelWidth + j] = weights[index++];
                }
            }
        }
    }
}